import React, { 
	Component, Image, Navigator, AsyncStorage, StyleSheet, View, Text, TouchableHighlight 
} from 'react-native';

import ExRouter from 'ExRouter';
import ExNavigator from '@exponent/react-native-navigator';
import { getUser } from 'Storage';
import { Motion, spring } from 'react-motion/native';
import { connect } from 'react-redux/native';
import { loadUser } from '../redux/user';

var strokeLogo = 'data:image/png;base64,';
var backgroundImage = 'data:image/jpeg;base64,';

class NewSplash extends React.Component {
	componentDidMount() {
		setTimeout(() => {
		 	getUser().then(user => {
	  			if(!user) {
	  				this.props.navigator.push(ExRouter.getLoginRoute());
	  			} else {
	  				this.props.navigator.push(ExRouter.getLoginRoute());
					
					// when we want to load the user from async	storage on app load
					// we will reinstate this code  				
	  				// this.props.dispatch(loadUser(user));
	  				// this.props.navigator.push(ExRouter.getDashboardRoute());
	  				// this.props.navigator.push(ExRouter.getOnboardingRoute());
	  			}
	  		});
		}, 1000);
	}
	render() {
		return (
			<Image 
			  resizeMode={Image.resizeMode.cover}      
			  source={{uri: backgroundImage}}
			  style={styles.container}>
			  <Motion defaultStyle={{scale: 0.4, opacity: 0}} style={{scale: spring(1, [200, 17]), opacity: spring(1)}}>
			  {m => 
			    <View style={{
			      opacity: m.opacity, 
			      alignItems: 'center',
			      justifyContent: 'center',
			      height: 400,
			    }}>
			      <Image style={{width: 90, height: 100, transform: [{scale: m.scale}]}} source={{uri: strokeLogo }} />
			      <View>
			        <Text style={styles.logoTextContainer}>Hanzi Gold</Text>
			      </View>
			    </View>
			  }
			  </Motion>
			</Image>
		);
	}
}

let styles = StyleSheet.create({
  container: {
  	flexDirection: 'column',
    flex: 1,
    backgroundColor: 'transparent'
  },
  logoTextContainer: {
    color: '#fff',
    fontSize: 35,
    marginTop: 20,
    textAlign: 'center'
  }
});

export default connect(state => ({}))(NewSplash);

